    public List<DeployerAddedEventResponse> getDeployerAddedEvents(
            TransactionReceipt transactionReceipt) {
        List<Contract.EventValuesWithLog> valueList =
                extractEventParametersWithLog(DEPLOYERADDED_EVENT, transactionReceipt);
        ArrayList<DeployerAddedEventResponse> responses =
                new ArrayList<DeployerAddedEventResponse>(valueList.size());
        for (Contract.EventValuesWithLog eventValues : valueList) {
            DeployerAddedEventResponse typedResponse = new DeployerAddedEventResponse();
            typedResponse.log = eventValues.getLog();
            typedResponse.account = (String) eventValues.getIndexedValues().get(0).getValue();
            responses.add(typedResponse);
        }
        return responses;
    }

